  [],\n\t\"num_tags\": 0,\n\t\"name\": \"gis-map-of-mosaicked-landsat-7-etm-satellite-imagery-of-the-marshall-islands-micronesia-federat\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These maps show for the first time an accurate
  georeferenced mosaic of the Marshall Islands, the Federated States of Micronesia,
  the Republic of Palau and their respective corresponding shallow water areas. Shallow-water
  (generally, less than 30 meters) bank and land areas in these areas were identified
  through analysis of Landsat 7 ETM+ satellite imagery. The mosaics are laid over
  ETOPO2 Bathymetric Data to provide an enhanced understanding of how the Atolls and
  Islands fit together. In addition selected islands and atolls are shown next to
  the mosaic. This project was conducted in support of the U.S. Coral Reef Task Force.nnData
  in this accession are best used with appropriate Geographic Information System (GIS)
  software.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
